import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu)
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Click the mobile menu trigger
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Screenshot after opening mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Wait for a category link in the mobile menu (e.g., Electronics)
    // Try to find a link with text 'Electronics' inside the overlay
    const electronicsLink = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//a[contains(text(),"Electronics")]',
      { timeout: 5000 }
    );

    // Click the Electronics link
    await electronicsLink.click();

    // Wait for main content to update (e.g., heading with 'Electronics')
    await page.waitForSelector('text=Electronics', { timeout: 5000 });

    // Screenshot after navigating to category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_electronics.png'));

    // Re-open the mobile menu
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Screenshot after re-opening mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_reopened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_reopened.png'));

    // Close the mobile menu using the close button
    // Try to find the close button inside the overlay
    const closeBtn = await page.waitForSelector(
      'xpath=//div[contains(@id,"mobileMenuOverlay")]//button[contains(@class,"close-mobile-menu")]',
      { timeout: 5000 }
    );
    await closeBtn.click();

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_mobile_menu_closed.png'));

    // Extract data: verify that Electronics category is shown in main content
    const heading = await page.textContent('h2');
    const categoryShown = heading && heading.toLowerCase().includes('electronics');

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, navigated to Electronics, re-opened and closed menu.",
      extractedData: {
        categoryHeading: heading,
        categoryShown
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
